import React from "react";

export default function Home(){
    return (
        <div className="outlet">
            <CustomTable classnames={["table", "shadow", "align-items-center", "w-60"]}
                data={currentTaskList}
                headers={["Task", "Status"]}
                columns={["task", "status"]}>
            </CustomTable>
        </div>
    )
}
